import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import { useState } from 'react';
function TeacherSection() {
  const [teacher, setTeacher] = useState([
        {
      name: 'Dr. Raj Kulkarni',
      position: 'President',
      email: 'raj.kulkarni@gcekarad.ac.in',
      contact: '9876543210'
    },
    {
      name: 'Dr. Arun Patokar',
      position: 'Head',
      email: 'arunmpatokar@mail.com',
      contact: '8976565690'
    },
    {
      name: 'Prof. R. S. Mawale',
      position: 'Internship activity coordinator',
      email: 'rajesh.mawale@mail.com',
      contact: '8976568778'
    },
    {
      name: 'Prof. S. A. Morkhade',
      position: 'Social Media',
      email: 'innovationcouncil@mail.com',
      contact: '7998766768'
    }
  ]);
  return (
    <div>
    <h2 className='text-center m-5'>Teacher</h2>
    <Row xs={1} md={3} className="g-4">
    {teacher.map((teacher, idx) => (
      <Col key={idx}>
        <div className='my-4'>
          <Card>
            <img
              src="https://cdn.pixabay.com/photo/2020/07/01/12/58/icon-5359553_1280.png"
              roundedCircle
              width="100"
              height="100"
              className="rounded-circle shadow-1-strong center"
              style={{ margin: "auto" }}
            />
            <Card.Body style={{ marginLeft: '2vw' , fontFamily:'emoji'}}>
              <Card.Title>Name: {teacher.name}</Card.Title>
              <Card.Text>
                <h5>Position: {teacher.position}</h5>
                <h5>Email: {teacher.email}</h5>
                <h5>Contact: {teacher.contact}</h5>
              </Card.Text>
            </Card.Body>
          </Card>
        </div>
      </Col>
    ))}
  </Row>
  </div>
  );
}

export default categories;
